PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE networks (
        tag TEXT PRIMARY KEY,
        name TEXT,
        latitude REAL,
        longitude REAL,
        meta BLOB
    ) WITHOUT ROWID;
CREATE TABLE stations (
        hash TEXT PRIMARY KEY,
        name TEXT,
        latitude REAL,
        longitude REAL,
        stat BLOB,
        network_tag TEXT
    ) WITHOUT ROWID;
COMMIT;
